import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // 기본 CSS 파일을 추가
import App from './App';
import CalendarComponent from './Calendar'; // CalendarComponent 가져오기

ReactDOM.render(
  <React.StrictMode>
    <App />
    <CalendarComponent /> {/* 캘린더 컴포넌트 추가 */}
  </React.StrictMode>,
  document.getElementById('root')
);
